import React from 'react';
import { View, Text, SafeAreaView } from 'react-native';

const HomeScreen = () => {
    const { item } = this.props.route.params;
    return (
        <SafeAreaView style={{ flex: 1 }}>
            {item}
        </SafeAreaView>
    );
};

export default HomeScreen;
